import React from 'react';
import ReactDom from 'react-dom';
import './index.css'

let cdate = new Date();
cdate = cdate.getHours();
let message = "";

if(cdate>=0 && cdate<12 )
{
    message="Good Morning";
}
else if(cdate>=12 && cdate<17)
{
    message="Good Afternoon";
}
else if(cdate>=17 && cdate<19)
{
    message="Good Afternoon";
}
else if(cdate>=19 && cdate<=24){
    message="Good Night";
}

ReactDom.render(
<>
<h1>Hello Ajay..{message}</h1>
</>,
document.getElementById('root')
);
